- input: TEXT,F3XA,,"1.)  As requested in the RFI letter this amendment includes the
    H1 form which was inadvertently excluded from the original report.      2.)  As
    requested in the RFI letter this amendment corrects a contribution totaling $5000
    from the International Union of Bricklayers and Allied Craftsworkers PAC (C00003632)
    that was incorrectly reported as being received from the International Union of
    Bricklayers and Allieds Craftsmen (C70000344) on Schedule A of the original report.      3.)  This
    amendment corrects a mistake in the federal/non-federal allocation as reported
    on Schedule H4 of the original report.  The federal portion of H4 line 21a administrative
    expenses was inadvertently calculated at 34% and has been adjusted to the apporiate
    level of 36%.  Since no NonFederal H3-Line 18a transfers occurred during this
    period no additional adjustments were made.      4.)  This amendment corrects
    the text record on form F3XN from the original report.  The memo entries in January
    and February showing the shared activity expenses that were inadvertently disbursed
    from the non-federal account total $8839.64.  A transfer to the non-federal account
    was made on June 30th of which $3182.27 covers the federal portion of the shared
    activity (36%).      5.)  This amendment includes 3 itemized contributions totaling
    $265 from Richard Anderson (431 Baird St Waukesha WI  53189-7403) that were mistakenly
    reported as unitemized on the original report due to a database error.",
  record: <fec.version.v5_0.TEXT.Records instance at 0x2b5d440>
